import { subLogger } from '@clockwork/logging';
import { Libc } from '@clockwork/common';
import { Inject } from '@clockwork/native';
import { getSelfProcessName } from '@clockwork/native/dist/utils.js';

//base64 encoded elf files
const soFixer64 =
    '';
let soFixer32 =
    '';

const logger = subLogger('sodump');
let do_dlopen = null;
let call_ctor = null;
let moduleBaseAddress = null;
let hooked = false;
const mutex_size = Process.pointerSize === 4 ? 24 : 40;
const mutex_addr = Memory.alloc(mutex_size);
mutex_addr.writeByteArray(new Array(mutex_size).fill(0));

let handle = NULL;
let hash_dumped_libs = new Map();

Libc.pthread_mutex_init(mutex_addr, NULL);

function drop_so_fixer(buffer: any, file_name: string) {
    let process_name = getSelfProcessName();
    let files_dir = '/data/data/' + process_name;
    let full_path = files_dir + '/' + file_name;
    logger.info(full_path);
    //@ts-ignore
    let file: any = new File(full_path, 'wb');
    file.write(buffer);
    file.close();
    logger.info(full_path);
    return full_path;
}

function dlopen_lib(so_name: string, libso: Module, sofixer: string) {
    if (handle.isNull()) {
        let systemPtr = Module.getExportByName('libc.so', 'system');
        let system = new NativeFunction(systemPtr, 'int', ['pointer']);
        let cmd = Memory.allocUtf8String(`chmod 777 ${sofixer} 2>&1`);
        system(cmd);
        cmd = Memory.allocUtf8String(`base64 -d ${sofixer} > ${sofixer}_.so  2>&1`);
        system(cmd);
        cmd = Memory.allocUtf8String('chmod 755 _${sofixer} 2>&1');
        system(cmd);

        let dlopenPtr = Module.getExportByName('libc.so', 'dlopen');
        let dlopen = new NativeFunction(dlopenPtr, 'pointer', ['pointer', 'int']);
        let hdl = dlopen(Memory.allocUtf8String(`${sofixer}_.so`), 2);
        logger.info('HDL -> ' + hdl);
        return hdl;
    }

    return handle;
}

function dump_lib(so_name: string) {
    let libso = Process.findModuleByName(so_name);
    if (libso == null) {
        return -1;
    }
    const generateRandomHex = (length: number) => [...Array(length)].map(() => Math.floor(Math.random() * 16).toString(16)).join('');
    const process_name = getSelfProcessName();
    const files_dir = `/data/data/${process_name}/`;
    const initial_path = `${so_name}_dump.so`;
    const final_path = `${so_name}_${libso.base}_${libso.size}.so`;

    Memory.protect(libso.base, libso.size, 'rwx');
    //libso_buffer is never used, we probably will need to remove it
    // let libso_buffer = libso.base.readByteArray(libso.size);

    let sofixer = '';
    if (Process.arch == 'arm') {
        sofixer = drop_so_fixer(soFixer32, generateRandomHex(16) + 'libdumpfixerArm32.so');
    } else if (Process.arch == 'arm64') {
        sofixer = drop_so_fixer(soFixer64, 'libdumpfixerArm64.so');
    } else {
        logger.error('Not supported arch' + Process.arch);
        return;
    }

    dump_so_file(libso.base, libso.size, initial_path);
    logger.info(sofixer);
    let systemPtr = Module.getExportByName('libc.so', 'system');
    let system = new NativeFunction(systemPtr, 'int', ['pointer']);
    let cmd = Memory.allocUtf8String(`chmod 777 ${sofixer} 2>&1`);
    system(cmd);
    cmd = Memory.allocUtf8String(`base64 -d ${sofixer} > ${sofixer}_.so  2>&1`);
    system(cmd);
    cmd = Memory.allocUtf8String(`chmod 777 ${files_dir}${initial_path} 2>&1`);
    system(cmd);

    handle = dlopen_lib(so_name, libso, sofixer);
    logger.info(handle.toString());
    if (!handle.isNull()) {
        let dlsymPtr = Module.getExportByName('libc.so', 'dlsym');
        let dlsym = new NativeFunction(dlsymPtr, 'pointer', ['pointer', 'pointer']);
        let dlclosePtr = Module.getExportByName('libc.so', 'dlclose');
        let dlclose = new NativeFunction(dlclosePtr, 'int', ['pointer']);

        let fixMePtr = dlsym(handle, Memory.allocUtf8String('_Z5fixMePcS_S_'));
        logger.info('fixme->' + fixMePtr.toString());
        if (!fixMePtr.isNull()) {
            let fixMe = new NativeFunction(fixMePtr, 'void', ['pointer', 'pointer', 'pointer']);
            try {
                let base_lib = Memory.allocUtf8String(`${libso.base}`);
                let init_path = Memory.allocUtf8String(`${files_dir}${initial_path}`);
                let out_path = Memory.allocUtf8String(`${files_dir}${final_path}`);
                fixMe(base_lib, init_path, out_path);
                logger.info('DONE!!!');
                logger.info(`${sofixer}_.so -m ${libso.base}` + ` -s ${files_dir}${initial_path}` + ` -o ${files_dir}${final_path} 2>&1`);
                logger.info(`${files_dir}${initial_path}`);
                logger.info(`${files_dir}${final_path}`);
            } catch (error) {
                logger.info(`Offsets -> ${libso.base}`);
                logger.error(error);
            } finally {
                logger.info(dlclose(handle).toString());
                handle = NULL;
                logger.info('DLCLOSE');
            }
        } else {
            logger.error("Couldn't find the symbols _Z5fixMePcS_S_");
        }
    } else {
        logger.error('Failed to load lib!');
    }
}

function dump_so_file(decompressed_ptr: NativePointer, file_size: number, file_path: string) {
    let process_name = getSelfProcessName();
    let files_dir = '/data/data/' + process_name;
    Memory.protect(decompressed_ptr, file_size, 'rwx');
    let buffer = decompressed_ptr.readByteArray(file_size);
    logger.info(files_dir + '/' + file_path);
    //@ts-ignore
    let file: any = new File(files_dir + '/' + file_path, 'wb');
    file.write(buffer);
    file.close();
}

function dump_from_maps() {
    const self = getSelfProcessName() ?? '';
    //@ts-ignore
    const modules = Process.enumerateModulesSync();
    modules.forEach((module: Module) => {
        if (module.path.includes(self) && !module.path.endsWith('/base.odex') && !module.path.includes('libdumpfixer')) {
            let libname = module.path.split('/').pop();
            if (hash_dumped_libs.get(libname) == undefined) {
                dump_lib(module.path.split('/').pop()!!);
                hash_dumped_libs.set(libname, 'true');
            }
        }
    });
}

function initSoDump() {
    const self = getSelfProcessName() ?? '';
    Inject.afterInitArrayModule(({ path, name }) => {
        if (path.includes(self) && !path.endsWith('/base.odex') && !path.includes('libdumpfixer')) {
            if (Libc.pthread_mutex_lock(mutex_addr) == 0x0) {
                try {
                    if (hash_dumped_libs.get(name) == undefined) {
                        dump_lib(name);
                        hash_dumped_libs.set(name, 'true');
                    }
                } catch (error) {
                    logger.error(error);
                } finally {
                    Libc.pthread_mutex_unlock(mutex_addr);
                }
            }
        } else if (name.includes('libc.so')) {
            if (Libc.pthread_mutex_lock(mutex_addr) == 0x0) {
                try {
                    dump_from_maps();
                } catch (error) {
                    logger.error(error);
                } finally {
                    Libc.pthread_mutex_unlock(mutex_addr);
                }
            }
        }
    });
}

export { initSoDump };
